INSERT INTO `course_content` (`id`, `name`, `slug`, `description`, `iframe`, `thumbnail_url`, `course`, `create_date`, `create_uid`) VALUES
(1, 'Django, Curso de Django para Principiantes', 'django-curso-de-django-para-principiantes', 'Django es el Framework de desarrollo web mas popular de Python. Este framework permite crear aplicaciones web backend y frontend de forma rapida y sencilla a traves de sus funcionalidades ya incluidas, como la creacion de formularios, proteccion de rutas, su motor de plantillas, conexion a base de datos y el uso de su ORM, ademas de un panel de administracion. En este curso aprenderemos a crear aplicaciones con Django para que a futuro puedas usar este framework como una opcion mas al crear aplicaciones web, usando Python.', 'https://www.youtube.com/embed/T1intZyhXDU', 'https://i.ytimg.com/vi/T1intZyhXDU/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG&rs=AOn4CLAMCGBW23SEG8mLfeFQJyPnhwsFBA', 1, '2023-04-30 19:26:59', 13),
